import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { styled } from '@mui/system';

const StyledAppBar = styled(AppBar)({
  backgroundColor: '#000000',
  padding: '10px 20px',
});

const StyledButton = styled(Button)({
  color: '#ffffff',
  '&:hover': {
    color: '#cccccc',
  },
});

const LogoContainer = styled(Box)({
  display: 'flex',
  alignItems: 'center',
});

const Leaf = styled('span')({
  color: '#00ff00', // Green color for the leaf
  fontSize: '1.2rem',
  marginLeft: '4px',
});

const Navbar = () => {
  return (
    <StyledAppBar position="static">
      <Toolbar>
        {/* Logo with Text and Leaf */}
        <LogoContainer sx={{ flexGrow: 1 }}>
          <Typography
            variant="h5"
            sx={{
              fontWeight: 'bold',
              color: '#ffffff',
              fontFamily: 'inherit', // You can specify a font if needed
            }}
          >
            Baa M Boo
          </Typography>
          <Leaf>üçÉ</Leaf> {/* Using an emoji for the leaf; you can replace with an SVG if preferred */}
        </LogoContainer>

        {/* Navigation Links */}
        <Box>
          <StyledButton href="#home">Home</StyledButton>
          <StyledButton href="#men">Men</StyledButton>
          <StyledButton href="#women">Women</StyledButton>
          <StyledButton href="#cart">Cart</StyledButton>
          <StyledButton href="#contact">Contact</StyledButton>
        </Box>
      </Toolbar>
    </StyledAppBar>
  );
};

export default Navbar;
